import React from 'react';

const Dashboard = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h2>Welcome to KrishiSeva Dashboard</h2>
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '1rem', marginTop: '2rem' }}>
        <div style={{ border: '1px solid #ddd', padding: '1rem', borderRadius: '8px' }}>
          <h3>üèõÔ∏è Government Schemes</h3>
          <p>Access latest government schemes and subsidies</p>
        </div>
        <div style={{ border: '1px solid #ddd', padding: '1rem', borderRadius: '8px' }}>
          <h3>üíß Soil & Water Management</h3>
          <p>Learn effective conservation techniques</p>
        </div>
        <div style={{ border: '1px solid #ddd', padding: '1rem', borderRadius: '8px' }}>
          <h3>üå§Ô∏è Weather Forecasting</h3>
          <p>Get weather updates and crop recommendations</p>
        </div>
        <div style={{ border: '1px solid #ddd', padding: '1rem', borderRadius: '8px' }}>
          <h3>‚ôªÔ∏è Waste Management</h3>
          <p>Solutions for agricultural waste</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;

